/* eslint-disable jsx-a11y/alt-text */
import React from 'react';
import Formation from './Formation';
import Parent from './Parent';
import SideBar from './SideBar';


const Dashboard = () => {
    
    
    return (
        <div>
            <div className="flex">
                <SideBar/>
                <div className="h-screen flex-1 p-7">
                    <Formation/>
                    <Parent/>
                    
                </div>
            </div>
        </div>
    );
};

export default Dashboard;
